import StatusCard from 'components/StatusCard';

import Hired from 'components/Hired';
import { db } from '../firebase';
import { useEffect, useState } from 'react';



export default function Dashboard() {

    const [posts, setPosts] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            const result = await fetch('http://localhost:5000/api/workers/')
            const jsonResult = result.json()

            setPosts(jsonResult)

        }
        fetchData()
    }, [])
    console.log(posts)

    return (
        <>
            <div className="bg-light-blue-500 px-2 md:px-4 h-20" />


            <div className="px-1 md:px-8 -mt-10">
                <div className="container mx-auto max-w-full">
                    <div className="grid grid-cols-1 lg:grid-cols-2 xl:grid-cols-4 mb-4">
                        <StatusCard
                            color="pink"
                            icon="trending_up"
                            title="Notification"
                            amount="22"

                            date="This Week"
                        />
                        <StatusCard
                            color="orange"
                            icon="groups"
                            title="Hired Workers"
                            amount="12"

                            date="Since last week"
                        />
                        <StatusCard
                            color="purple"
                            icon="paid"
                            title="Transactions"
                            amount="Rs 9224"

                            date="Since yesterday"
                        />
                        <StatusCard
                            color="blue"
                            icon="poll"
                            title="Word Done"
                            amount="49.65%"

                            date="Since last month"
                        />
                    </div>
                </div>
            </div>


            <div className="px-3 md:px-8 h-auto">
                <div className="container mx-auto max-w-full">
                    <div className="grid grid-cols-1 xl:grid-cols-1">
                        <div className="xl:col-start-1 xl:col-end-4 px-4 mb-14">
                          {posts.map(() => {
            return (
              <div className=" hover:mt-3  rounded-3xl h-full flex justify-center mt-5 items-center">

              </div>
            );
          })}

                        </div>

                    </div>
                </div>
            </div>
        </>
    );
}
